import { ReactComponent as GoogleIcon } from '../img/Google.svg';
import { useNavigate } from 'react-router-dom';

const GoogleLogin = ({ onSuccess }) => {
  const navigate = useNavigate();

  const link = `https://ttoon.site/oauth2/authorization/google`;

  const loginHandler = () => {
    window.location.href = link;
  };

  const handleGoogleLogin = (response) => {
    // 성공적으로 로그인한 경우
    onSuccess(response); // 받은 데이터를 부모 컴포넌트로 전달
  };

  return (
    <button type='button' onClick={loginHandler} style={{ border: 'none', padding: '0', marginBottom: '3%' }}>
      <GoogleIcon />
    </button>
  );
};

export default GoogleLogin;
